import React from 'react';

const Header = () => (
  <header>
    <h1>6MWT Data Viewer</h1>
    <nav>
      <ul>
        <li><a href="#tests">Tests</a></li>
        <li><a href="#patients">Patients</a></li>
      </ul>
    </nav>
  </header>
);

export default Header;
